{
  "name": "UBX-MGA-BDS-EPH",
  "class_id": "0x13",
  "message_id": "0x03",
  "description": "BeiDou ephemeris assistance for satellites svId 1..37. This message allows the delivery of BeiDou D1/D2 ephemeris assistance to a receiver.",
  "message_type": "input",
  "payload": {
    "length": {
      "fixed": 88
    },
    "fields": [
      {
        "name": "type",
        "byte_offset": 0,
        "data_type": "U1",
        "description": "Message type (0x01 for this type)"
      },
      {
        "name": "version",
        "byte_offset": 1,
        "data_type": "U1",
        "description": "Message version (0x00 for this version)"
      },
      {
        "name": "svId",
        "byte_offset": 2,
        "data_type": "U1",
        "description": "BeiDou satellite identifier (see Satellite Numbering)"
      },
      {
        "name": "reserved0",
        "byte_offset": 3,
        "data_type": "U1",
        "description": "Reserved",
        "reserved": true
      },
      {
        "name": "SatH1",
        "byte_offset": 4,
        "data_type": "U1",
        "description": "Autonomous satellite Health flag"
      },
      {
        "name": "IODC",
        "byte_offset": 5,
        "data_type": "U1",
        "description": "Issue of Data, Clock"
      },
      {
        "name": "a2",
        "byte_offset": 6,
        "data_type": "I2",
        "description": "Time polynomial coefficient 2",
        "scale": {
          "raw": "2^-66",
          "multiplier": 2.168404344971009e-20
        },
        "unit": "s/s^2"
      },
      {
        "name": "a1",
        "byte_offset": 8,
        "data_type": "I4",
        "description": "Time polynomial coefficient 1",
        "scale": {
          "raw": "2^-50",
          "multiplier": 8.881784197001252e-16
        },
        "unit": "s/s"
      },
      {
        "name": "a0",
        "byte_offset": 12,
        "data_type": "I4",
        "description": "Time polynomial coefficient 0",
        "scale": {
          "raw": "2^-33",
          "multiplier": 1.1641532182693481e-10
        },
        "unit": "s"
      },
      {
        "name": "toc",
        "byte_offset": 16,
        "data_type": "U4",
        "description": "Clock data reference time",
        "scale": {
          "raw": "2^3",
          "multiplier": 8.0
        },
        "unit": "s"
      },
      {
        "name": "TGD1",
        "byte_offset": 20,
        "data_type": "I2",
        "description": "Equipment Group Delay Differential",
        "scale": {
          "raw": "0.1",
          "multiplier": 0.1
        },
        "unit": "ns"
      },
      {
        "name": "URAI",
        "byte_offset": 22,
        "data_type": "U1",
        "description": "User Range Accuracy Index"
      },
      {
        "name": "IODE",
        "byte_offset": 23,
        "data_type": "U1",
        "description": "Issue of Data, Ephemeris"
      },
      {
        "name": "toe",
        "byte_offset": 24,
        "data_type": "U4",
        "description": "Ephemeris reference time",
        "scale": {
          "raw": "2^3",
          "multiplier": 8.0
        },
        "unit": "s"
      },
      {
        "name": "sqrtA",
        "byte_offset": 28,
        "data_type": "U4",
        "description": "Square root of semi-major axis",
        "scale": {
          "raw": "2^-19",
          "multiplier": 1.9073486328125e-6
        },
        "unit": "m^0.5"
      },
      {
        "name": "e",
        "byte_offset": 32,
        "data_type": "U4",
        "description": "Eccentricity",
        "scale": {
          "raw": "2^-33",
          "multiplier": 1.1641532182693481e-10
        }
      },
      {
        "name": "omega",
        "byte_offset": 36,
        "data_type": "I4",
        "description": "Argument of perigee",
        "scale": {
          "raw": "2^-31",
          "multiplier": 4.656612873077393e-10
        },
        "unit": "semi-circles"
      },
      {
        "name": "Deltan",
        "byte_offset": 40,
        "data_type": "I2",
        "description": "Mean motion difference from computed value",
        "scale": {
          "raw": "2^-43",
          "multiplier": 1.1368683772161603e-13
        },
        "unit": "semi-circles/s"
      },
      {
        "name": "IDOT",
        "byte_offset": 42,
        "data_type": "I2",
        "description": "Rate of inclination angle",
        "scale": {
          "raw": "2^-43",
          "multiplier": 1.1368683772161603e-13
        },
        "unit": "semi-circles/s"
      },
      {
        "name": "MO",
        "byte_offset": 44,
        "data_type": "I4",
        "description": "Mean anomaly at reference time",
        "scale": {
          "raw": "2^-31",
          "multiplier": 4.656612873077393e-10
        },
        "unit": "semi-circles"
      },
      {
        "name": "Omega0",
        "byte_offset": 48,
        "data_type": "I4",
        "description": "Longitude of ascending node of orbital of plane computed according to reference time",
        "scale": {
          "raw": "2^-31",
          "multiplier": 4.656612873077393e-10
        },
        "unit": "semi-circles"
      },
      {
        "name": "OmegaDot",
        "byte_offset": 52,
        "data_type": "I4",
        "description": "Rate of right ascension",
        "scale": {
          "raw": "2^-43",
          "multiplier": 1.1368683772161603e-13
        },
        "unit": "semi-circles/s"
      },
      {
        "name": "i0",
        "byte_offset": 56,
        "data_type": "I4",
        "description": "Inclination angle at reference time",
        "scale": {
          "raw": "2^-31",
          "multiplier": 4.656612873077393e-10
        },
        "unit": "semi-circles"
      },
      {
        "name": "Cuc",
        "byte_offset": 60,
        "data_type": "I4",
        "description": "Amplitude of cosine harmonic correction term to the argument of latitude",
        "scale": {
          "raw": "2^-31",
          "multiplier": 4.656612873077393e-10
        },
        "unit": "radians"
      },
      {
        "name": "Cus",
        "byte_offset": 64,
        "data_type": "I4",
        "description": "Amplitude of sine harmonic correction term to the argument of latitude",
        "scale": {
          "raw": "2^-31",
          "multiplier": 4.656612873077393e-10
        },
        "unit": "radians"
      },
      {
        "name": "Crc",
        "byte_offset": 68,
        "data_type": "I4",
        "description": "Amplitude of cosine harmonic correction term to the orbit radius",
        "scale": {
          "raw": "2^-6",
          "multiplier": 0.015625
        },
        "unit": "m"
      },
      {
        "name": "Crs",
        "byte_offset": 72,
        "data_type": "I4",
        "description": "Amplitude of sine harmonic correction term to the orbit radius",
        "scale": {
          "raw": "2^-6",
          "multiplier": 0.015625
        },
        "unit": "m"
      },
      {
        "name": "Cic",
        "byte_offset": 76,
        "data_type": "I4",
        "description": "Amplitude of cosine harmonic correction term to the angle of inclination",
        "scale": {
          "raw": "2^-31",
          "multiplier": 4.656612873077393e-10
        },
        "unit": "radians"
      },
      {
        "name": "Cis",
        "byte_offset": 80,
        "data_type": "I4",
        "description": "Amplitude of sine harmonic correction term to the angle of inclination",
        "scale": {
          "raw": "2^-31",
          "multiplier": 4.656612873077393e-10
        },
        "unit": "radians"
      },
      {
        "name": "reserved1",
        "byte_offset": 84,
        "data_type": {
          "array_of": "U1",
          "count": 4
        },
        "description": "Reserved",
        "reserved": true
      }
    ]
  }
}

